import React from "react"
import Song from "./Song"

const SongList = ({ albums }) => {

    return (
        <table>
            <tbody>
                <tr>
                    <th>song_name</th>
                    <th>Released</th>
                    <th>Length</th>

                </tr>
                {
                    albums.map(Song => {
                        return <Song key={albums.song} song={albumss} />;
                    })
                }
            </tbody>
        </table>
    );
}

export default SongList;
